import React from "react";
import {Navbar,Card} from 'react-bootstrap';

class App extends React.Component{
  render(){
    return (
      <React.Fragment>
        <div className="App">
          <Navbar expand="lg" bg="blue" >Hello GoMyCode</Navbar>
          <Card>
            <Card.Img src="https://unsplash.com/fr/@mossikz?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText"></Card.Img>
            </Card>
          <Card>Carte 2</Card>
          <Card>Carte 3</Card>
        </div>
      </React.Fragment>
    )
  }
}

export default App;
